import style from "./Form.module.css"


export default function Form() {
    return (
        <div className={style.containerForm}>
            <form className={style.form}>
                <label>Username: </label>
                <input></input>

                <label>Password: </label>
                <input></input>

                <button>Login</button>
            </form>
        </div>

    )
};
